function GaleriaSection({ vis }) {
  const [lightboxOpen, setLightboxOpen] = React.useState(false);
  const [lightboxIndex, setLightboxIndex] = React.useState(0);

  const openLightbox = (index) => {
    setLightboxIndex(index);
    setLightboxOpen(true);
    document.body.style.overflow = "hidden";
  };

  const closeLightbox = () => {
    setLightboxOpen(false);
    document.body.style.overflow = "";
  };

  const prevPhoto = (e) => {
    e.stopPropagation();
    setLightboxIndex((prev) => (prev === 0 ? galeriaPhotos.length - 1 : prev - 1));
  };

  const nextPhoto = (e) => {
    e.stopPropagation();
    setLightboxIndex((prev) => (prev === galeriaPhotos.length - 1 ? 0 : prev + 1));
  };

  React.useEffect(() => {
    if (!lightboxOpen) return;
    const handleKey = (e) => {
      if (e.key === "Escape") closeLightbox();
      if (e.key === "ArrowLeft") setLightboxIndex((p) => (p === 0 ? galeriaPhotos.length - 1 : p - 1));
      if (e.key === "ArrowRight") setLightboxIndex((p) => (p === galeriaPhotos.length - 1 ? 0 : p + 1));
    };
    window.addEventListener("keydown", handleKey);
    return () => window.removeEventListener("keydown", handleKey);
  }, [lightboxOpen]);

  return (
    <>
      <section id="galeria" data-anim className="sec" style={{ minHeight: "auto" }}>
        <div className="sec__overlay" />
        <div className={`sec__inner ${vis ? "revealed" : ""}`}>
          <Label>Registro</Label>
          <Title>Galeria de Fotos</Title>
          <OrnamentLine />

          <div className="galeria-grid">
            {galeriaPhotos.map((photo, i) => (
              <div key={i} className="galeria-item" onClick={() => openLightbox(i)}>
                <img src={photo.src} alt={photo.caption} className="galeria-img" loading="lazy" />
                <div className="galeria-overlay">
                  <span className="galeria-caption">{photo.caption}</span>
                  <span className="galeria-zoom">&#x1F50D;</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {lightboxOpen && (
        <div className="lb-backdrop" onClick={closeLightbox}>
          <button className="lb-close" onClick={closeLightbox}>&times;</button>
          <button className="lb-arrow lb-arrow--left" onClick={prevPhoto}>&#10094;</button>
          <div className="lb-content" onClick={(e) => e.stopPropagation()}>
            <img src={galeriaPhotos[lightboxIndex].src} alt={galeriaPhotos[lightboxIndex].caption} className="lb-img" />
            <div className="lb-info">
              <span className="lb-caption">{galeriaPhotos[lightboxIndex].caption}</span>
              <span className="lb-counter">{lightboxIndex + 1} / {galeriaPhotos.length}</span>
            </div>
          </div>
          <button className="lb-arrow lb-arrow--right" onClick={nextPhoto}>&#10095;</button>
        </div>
      )}
    </>
  );
}

